import React from 'react'
import banner from './images/blue-door.jpg'
import Navbar from '../Navbar/Navbar';
export default function Home() {
  return (
    <>
      <Navbar/>
    
      <div className='m-' >
            <img src={banner}/>
      </div>
    </>
  )
}
